  <div>
    <h1>The Auth Index Page - {props.appName}</h1>
    <User name="Anderson" age={"30"}/>
  </div>
);

authIndexPage.getInitialProps = (context) => {
  console.log(context);
  const promise = new Promise((resolve, reject) => {
    setTimeout( () => {
      resolve({appName: 'Super App Auth'})
    }, 1000)
  });
  return promise;
}

export default authIndexPage;
